import Link from 'next/link';
import '../styles/index.css';

const headerStyle = {
  marginLeft: 'auto'
};

const linkStyle = {
  marginRight: '30px'
}

const Header = () => (
  <div className="w-full p-12 sm:p-8 inline-flex">
    <Link href="/">
      <a>stephandvic.com</a>
    </Link>
    <div style={headerStyle}>
      <Link href="/about">
        <a style={linkStyle}>about</a>
      </Link>
    </div>
  </div>
);

export default Header;
